import styled from "styled-components";
import "./App.css";
import CompanyPage from "./Pages/CompanyPage";
import PersonPage from "./Pages/PersonPage";
import Footer from "./Widgets/Footer";
import HeaderMenu from "./Widgets/HeaderMenu";

import { useSelector } from "react-redux";
import { selectPage } from "./store/pageSlice";
import { Icon } from "./Widgets/svg/Icon";

const MainConteiner = styled.div`
  margin: 80px auto;
  width: 648px;
  height: 696px;
  background-color: #f4f4f4;
  border-radius: 8px;
`;

const Link = styled.a``;

const Icons = [
  <Icon id="arrow" className="all" />,
  <Icon id="adress" className="all" />,
  <Icon id="brDay" className="all" />,
  <Icon id="fax" className="all" />,
  <Icon id="mail" className="all" />,
  <Icon id="mobile" className="all" />,
  <Icon id="phone" className="all" />,
  <Icon id="site" className="all" />,
  <Icon id="user" className="all" />,
  <Icon id="dzen" className="all" />,
  <Icon id="facebook" className="all" />,
  <Icon id="isq" className="all" />,
  <Icon id="linkedin" className="all" />,
  <Icon id="instagtam" className="all" />,
  <Icon id="odnorlassniki" className="all" />,
  <Icon id="skype" className="all" />,
  <Icon id="telegram" className="all" />,
  <Icon id="tenchat" className="all" />,
  <Icon id="tiktok" className="all" />,
  <Icon id="twitter" className="all" />,
  <Icon id="viber" className="all" />,
];
function App() {
  // const [activePage, setActivePage] = useState(false);
  // const activePage = useSelector((state) => state.activePage.activePage);
  // console.log(User.person.firstName);

  const isActivePage = useSelector(selectPage);

  return (
    <div className="App">
      <HeaderMenu />
      <MainConteiner>
        {isActivePage ? <PersonPage /> : <CompanyPage />}

        {Icons.map((el) => (
          <a> {el}</a>
        ))}

        <Footer />
      </MainConteiner>
    </div>
  );
}

export default App;
